import React, { Component } from 'react'

export default class Todo extends Component {
    style=()=>{
        const{complete} = this.props.todo
        return {textDecoration:complete?"line-through":"none"}
    }
    render() {
        const {title}=this.props.todo
    return (
        <h3 className="text-dark text-center p-1 bg-light border-bottom" >
            <div className="d-flex" style={this.style()}>
            <i className="far fa-times-circle fa-sm float-left m-2 text-danger"></i>{title}<input type="checkbox" className="m-2 float-right"/>
            </div>
        </h3>
    )
    }
}
